import React, { Component } from 'react';
import './style.scss';

// Component import
import Header from './Components/Header';

class App extends Component {
  render() {
    return (
      <div className="naveen">

      <Header />
       <h1>Naveen Kharwar</h1>
      </div>
    );
  }
}

export default App;
